    return(
       <table className="table">
            <thead>
                <tr>
                    <th>#</th>
                    <th>Nome</th>
                    <th>Marca</th>
                    <th>Selecionar</th>
                </tr>
            </thead>

            <tbody>
                {
                    vetor.map((obj,indice) => {
                        <tr key={indice}>
                            <td></td>
                            <td></td>
                            <td></td>
                            <td></td>
                        </tr>
                    })
                }
            </tbody>
       </table>
    )
}

